import PropTypes from "prop-types";
function Button({text}) {
    return <button
        style={{
            backgroundColor : "black",
            color : "white"
        }}
    >{text}</button>
}
Button.propTypes = {
    text : PropTypes.string.isRequired
}
export default Button
